Irene Huss is a former European Ju-Jitsu champion, a mother of twin teenage girls and a Detective Inspector with the Violent Crimes Unit. Her husband, Krister, is a successful chef and luckily for Irene, he gladly shoulders a fair share of the household tasks. At the Violent Crimes Unit in Gothenburg, Irene encounters a wide range of criminal minds - from international serial killers to psychotic young girls. Each new case brings its share of quirks and quandaries to the table, sometimes forcing the entire team to put their lives on the line. Based on Helene Tursten's best selling novels. 


